import "./App.scss";
import HomePage from "./homePage/HomePage";
import Login from "./login/Login";
import { BrowserRouter, Route, Redirect, loggedIn } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Route exact path="/">
        {loggedIn ? <Redirect to="/HomePage" /> : <Login />}
      </Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
